import React from 'react'
import './Salaries.css'

function Salaries(props){
  return(
    <li className="listItem">
      <h2 id="name">{props.jobName}</h2>
      <p>${Math.round(props.jobSalary25)} to ${Math.round(props.jobSalary75)}</p>
    </li>
  )
}

export default Salaries;
